I think that this is correct: the user provides the new names for all the declarations above the declaration-to-be-deprecated.  The workflow should be
* the script replaces the old name by the new name in the original declaration;
* the new declarations get automatically generated with their autogenerated names (more on this later);
* the script retrieves the old autogenerated names and creates the aliases for the (now-non-existing) old autogenerated names to be deprecated in favour of the new ones that the user provided.

The part that I am not too happy about is that you have to provide the new autogenerated names by hand, rather than autogenerating them.  The issue is not actually retrieving those names, but rather matching the new ones with what the old ones were.  This is why you would have to provide the `to_additive` name of a `to_additivized` declaration.  In the specific case of `to_additive` the matching would be easy, as there is only one non-visible declaration, but with `simps` the matching is trickier.
